import React from 'react';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';
import styled from 'styled-components';

const Pica = styled.div`
background-color: gray;
color: gray;
text-align: center;
margin-top: 1vh;
margin-bottom: 1vh;

  &:hover {
  background-image: url('tile.png');
  color: #373fff;
  border-radius: 5px;
  }

`

const Apply = styled.div`
background-color: gray;
height: 100vh;
`

const Ccard = (props) => {
    return (
        <Pica >{props.text}</Pica>
    )
}

function App() {
  return (
      <Apply>
        <Container>
          <Row>
            <Col><Ccard text={"you"} color={"pink"}/></Col>
            <Col><Ccard text={"are"} color={"brown"}/></Col>
            <Col><Ccard text={"uh"} color={"chartreuse"}/></Col>          
          </Row>
          <Row>
            <Col><Ccard text={"ma"} color={"chartreuse"}/></Col>                      
            <Col><Ccard text={"zi"} color={"orange"}/></Col>
            <Col><Ccard text={"ng"} color={"brown"}/></Col>            
        </Row>
          <Row>
            <Col><Ccard text={"ur amazing!!!"} color={"brown"}/></Col>            
        </Row>
          <Row>
            <Col><Ccard text={"keep"} color={"yellow"}/></Col>
            <Col><Ccard text={"it"} color={"pink"}/></Col>
            <Col><Ccard text={"up!"} color={"orange"}/></Col>            
          </Row>
          <Row>
            <img alt="lamp" style={{width: '100%',height: 'auto',display:'block',margin:'auto'}} src="lamp.svg"/>
          </Row>

      </Container>
      </Apply>
  );
}

export default App;
